import './Layout.css';

export default function Layout() {
  return (
    <div className='main'>
      <img className='header_img' src="sport_images/page_2.png" alt="alt" />
      <div className='inner_sec'>
      <img src="sport_images/page_9.png" alt="alt" />

      </div>

    </div>
  )
}
